title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o13353.m31 -> o13390.m33 -> o13353.m26 -> o13390.m29 -> o13353.m9 -> o13353.m31
  o13390.m33 -> o13353.m26 -> o13390.m29 -> o13353.m9 -> o13353.m31 -> o13390.m33
  o13390.m12 -> o13353.m26 -> o13390.m29 -> o13353.m9 -> o13353.m31 -> o13390.m33 -> o13353.m26
  o13353.m26 -> o13390.m29 -> o13353.m9 -> o13353.m31 -> o13390.m33 -> o13353.m26
  o13353.m9 -> o13353.m31 -> o13390.m33 -> o13353.m26 -> o13390.m29 -> o13353.m9
  o13353.m22 -> o13390.m33 -> o13353.m26 -> o13390.m29 -> o13353.m9 -> o13353.m31 -> o13390.m33
  o13390.m2 -> o13353.m9 -> o13353.m31 -> o13390.m33 -> o13353.m26 -> o13390.m29 -> o13353.m9
  o13390.m29 -> o13353.m9 -> o13353.m31 -> o13390.m33 -> o13353.m26 -> o13390.m29
  o13390.m14 -> o13353.m26 -> o13390.m29 -> o13353.m9 -> o13353.m31 -> o13390.m33 -> o13353.m26

features:
  - inheritance
  - overriding
  - method
  - polymorphism

